DROP TABLE IF EXISTS `borrowreturn`;
CREATE TABLE `borrowreturn` (
  `id` int(10) NOT NULL COMMENT '单号',
  `deviceId` int(10) DEFAULT NULL COMMENT '设备编号',
  `deviceName` varchar(50) CHARACTER SET gbk DEFAULT NULL COMMENT '设备名称',
  `borrowTime` datetime DEFAULT NULL COMMENT '借出时间',
  `borrowOffice` varchar(50) CHARACTER SET gbk DEFAULT NULL COMMENT '借用科室',
  `borrowBy` varchar(20) CHARACTER SET gbk DEFAULT NULL COMMENT '借用人',
  `borrowSendBy` varchar(20) CHARACTER SET gbk DEFAULT NULL COMMENT '借出输送人',
  `lendBy` varchar(20) CHARACTER SET gbk DEFAULT NULL COMMENT '借出人',
  `lendTime` datetime DEFAULT NULL COMMENT '借出登记时间',
  `returnTime` datetime DEFAULT NULL COMMENT '归还时间',
  `returnSendBy` varchar(20) CHARACTER SET gbk DEFAULT NULL COMMENT '归还输送人',
  `receiveBy` varchar(20) CHARACTER SET gbk DEFAULT NULL COMMENT '归还接收人',
  `receiveTime` datetime DEFAULT NULL COMMENT '归还登记时间',
  `returnStatus` int(11) DEFAULT NULL COMMENT '设备归还状态(0坏了，1良好)',
  `status` int(11) DEFAULT NULL COMMENT '是否归还(0未还，1已还)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='借出归还表';

